options.rowCallback:
function(row, data) {
DTWidget.formatRound(this, row, data, 1, 4, 3, ',', '.');
DTWidget.formatRound(this, row, data, 3, 4, 3, ',', '.');
DTWidget.formatRound(this, row, data, 4, 4, 3, ',', '.');
}

ajax.data:
function(d) {
d.search.caseInsensitive = true;
d.search.smart = true;
d.escape = false;
var encodeAmp = function(x) { x.value = x.value.replace(/&/g, "%26"); }
encodeAmp(d.search);
$.each(d.columns, function(i, v) {encodeAmp(v.search);});
}

